import React from 'react'
import { Text, View, StyleSheet } from 'react-native'

const FiltersScreen = () => {
    return (
        <View style={styles.container}>
            <Text>Filter</Text>
        </View>
    )
}

export default FiltersScreen

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    }
})
